Delmira Agustini fue una poeta uruguaya que vivió entre 1886 y 1914. Este soneto forma parte de su obra poética, caracterizada por su intensidad emocional y su tratamiento del amor y el erotismo, temas que abordó de manera revolucionaria para su época.
